package model.forms;public class TaskFormModel {    private long idTask;    private String nume;    private String descriere;    private int complet;    private int deleted;    private long assignee;    private long reporter;    private long idProiect;    private long estimare;    private long idStatusTask;    public long getIdTask() {        return idTask;    }    public void setIdTask(long idTask) {        this.idTask = idTask;    }    public String getNume() {        return nume;    }    public void setNume(String nume) {        this.nume = nume;    }    public String getDescriere() {        return descriere;    }    public void setDescriere(String descriere) {        this.descriere = descriere;    }    public int getComplet() {        return complet;    }    public void setComplet(int complet) {        this.complet = complet;    }    public int getDeleted() {        return deleted;    }    public void setDeleted(int deleted) {        this.deleted = deleted;    }    public long getAssignee() {        return assignee;    }    public void setAssignee(long assignee) {        this.assignee = assignee;    }    public long getIdProiect() {        return idProiect;    }    public void setIdProiect(long idProiect) {        this.idProiect = idProiect;    }    public long getEstimare() {        return estimare;    }    public void setEstimare(long estimare) {        this.estimare = estimare;    }    public long getIdStatusTask() {        return idStatusTask;    }    public void setIdStatusTask(long idStatusTask) {        this.idStatusTask = idStatusTask;    }    @Override    public boolean equals(Object o) {        if (this == o) return true;        if (!(o instanceof TaskFormModel)) return false;        TaskFormModel that = (TaskFormModel) o;        if (idTask != that.idTask) return false;        if (complet != that.complet) return false;        if (deleted != that.deleted) return false;        if (assignee != that.assignee) return false;        if (idProiect != that.idProiect) return false;        if (estimare != that.estimare) return false;        if (idStatusTask != that.idStatusTask) return false;        if (nume != null ? !nume.equals(that.nume) : that.nume != null) return false;        return !(descriere != null ? !descriere.equals(that.descriere) : that.descriere != null);    }    @Override    public int hashCode() {        int result = (int) (idTask ^ (idTask >>> 32));        result = 31 * result + (nume != null ? nume.hashCode() : 0);        result = 31 * result + (descriere != null ? descriere.hashCode() : 0);        result = 31 * result + complet;        result = 31 * result + deleted;        result = 31 * result + (int) (assignee ^ (assignee >>> 32));        result = 31 * result + (int) (idProiect ^ (idProiect >>> 32));        result = 31 * result + (int) (estimare ^ (estimare >>> 32));        result = 31 * result + (int) (idStatusTask ^ (idStatusTask >>> 32));        return result;    }    public long getReporter() {        return reporter;    }    public void setReporter(long reporter) {        this.reporter = reporter;    }}